import { Link } from "react-router-dom";

function Navigation(){
    return(
        <>
        <div className="header">
        <nav>
                <ul >
                    <li>
                        <Link to ="/">Home</Link>
                    </li>
                    <li>
                        <Link to ="/world-news">World</Link>
                    </li>
                </ul>
            </nav>
        </div>
            
        </>
    )
}

export default Navigation;
